import React ,{useState} from 'react';
import  ReactDOM  from 'react-dom/client';
import './index.css';
import App from './App';

function MadeGoal(){
  return(
    <h1>Made the goal</h1>
  );
}
function MissGoal(){
  return(
    <h1>Miss the goal</h1>
  );
}

function Goal(props)  {
  const isGoal = props.isGoal;

  return(
  <>
    {isGoal ? <MadeGoal /> : <MissGoal /> }
  </>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  // <React.StrictMode>
  //   <App />
